class FoodItemList {
  List<FoodItem> foodItems;
  FoodItemList({@required this.foodItems});
}

class FoodItem{
  int id;
  String title;
  String hotel;
  double price;
  String imgUrl;
  int quantity;

  FoodItem({
    @required this.id,
    @required this.title,
    @required this.hotel,
    @required this.price,
    @required this.imgUrl,

    this.quantity = 1
});

  void incrementQuantity(){
    this.quantity += 1;
  }

  void decrementQuantity(){
    this.quantity -= 1;
  }
}